import React from 'react'

export default function Form({ form,fields }) {
    // console.log(form.fields);

    return (
        <div>
            <h4>{form.title}</h4>
    {fields.map((i)=> <label>{i.label}<input name={i.name} group={i.group} required={i.required}/></label>)}
        </div>
    )
}
